import React, { Component } from 'react'; 
import './App.css';

// Function that displays the heading message 
class App extends React.Component{
  render(){
    return(
      <h2>Juan's To-Do List</h2>,
      <h2>Today's date is {new Date().toLocaleDateString()}.</h2>
    );
  }
}
export default App;
